import React, { useState } from 'react'


function TodoList() {
    const [todos, setTodos] = useState(["walk the dog", "wash the car"]);

    const removeTodo = (id) => {
        todos.filter((todo) => todo.id !== id)
    }
  return (
    <div style={{display: 'flex', justifyContent: 'center', flexDirection: 'column', alignItems:'center', padding: '10px', backgroundColor: 'lightgrey', width: '50%', margin: '20px auto', gap: ''}}>
        {todos.map(todo => {
            return <div style={{display:'flex'}}>
                <div>{todo}</div>
                <i class="bi bi-trash3"></i>
            </div>
        })}
    </div>
  )
}

export default TodoList
